Bottle Shock (2008)  

Verenigde Staten
Drama
110 minuten

geregisseerd door Randall Miller
met Alan Rickman, Chris Pine en Rachael Taylor

In de jaren '70 was er opeens de opkomst van de Californische wijn. In dit verhaal zien we hoe de mensen van de Montelena Winery alle vooroordelen aandurfden toen ze met hun bijzondere Napa wijn, de elitaire wijnwereld trachtten binnen te komen. Het hoogtepunt werd een blinde proeverij in Parijs, 1976, die voor altijd als de 'Judgment of Paris' in zou gaan.


